Looking for solution:
Justin Chen helped me find a solution base on the org.eclipse.jst.jsf.core.jaslibraries extension point. Extending this point makes it easy to return a collection of files that I want to be shown in the preferences page.

Base on the solution:
I have two bundles: com.test.libraries and com.test.librariesProvider.
The com.test.libraries plugin has the following structure
  com.test.libraries
