        - lib1.jar
        - lib2.jar
    - plugin.xml

The second bundle is com.test.librariesProvider an this bundle extends the org.eclipse.jst.jsf.core.jsflibraries extension point using the following getArchiveFile() method:

public Collection getArchiveFiles() {
