 Bundle bundle = Platform.getBundle("com.test.libraries");
 URL archiveUrl = FileLocator.find(bundle, new Path(
"lib/lib1.jar"), Collections.EMPTY_MAP);
 file1.setSourceLocation(archiveUrl.getPath());
 return Collections.singleton(file1);
}

The idea is that the com.test.libraries bundle holds the libraries and the librariesProvider contributes those libraries to the jsflibraries preference page.

